import { Component, Inject } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-customers-list',
  templateUrl: './customers-list.component.html',
  styleUrls: ['./customers-list.component.css']
})
export class CustomersListComponent {
  public customers: Customer[] = [];

  constructor(http: HttpClient, @Inject('BASE_URL') baseUrl: string) {
    baseUrl = "https://getinvoices.azurewebsites.net/api/";
    console.log("Base" + baseUrl);
    http.get<Customer[]>(baseUrl + 'Customers').subscribe(result => {
      this.customers = result;
    }, error => console.error(error));
  }

  public delete(customer: Customer) {
    console.log("Delete" + customer.id);
  }
}

interface Customer {
  id: string;
  salutation: string;
  initials: string;
  firstname: string;
  firstname_ascii: string;
  gender: string;
  firstname_country_rank: string;
  firstname_country_frequency: string;
  lastname: string;
  lastname_ascii: string;
  lastname_country_rank: string;
  lastname_country_frequency: string;
  email: string;
  password: string;
  country_code: string;
  country_code_alpha: string;
  country_name: string;
  primary_language_code: string;
  primary_language: string;
  balance: 0;
  phone_Number: string;
  currency: string;
}
